import React from 'react';
import BooksTable from '../components/books-table';
import BookForm from './book-form';
import CategoryFilter from './category-filter';
import Navigation from './navigation';

const containerStyle = {
  border: '1px solid',
  margin: '3rem',
}
const App = () => (
  <div>
    <Navigation />
    <BooksTable />
    <CategoryFilter />
    <BookForm />
  </div>
);

export default App;
